import React, { useState, useEffect } from "react";
import AdminPanel from "../components/AdminPanel";
import UserManagement from "../components/UserManagement";
import LoginModal from "../components/LoginModal";

const Admin = ({
  addAccount,
  categories,
  addCategory,
  removeCategory,
  reorderCategory,
  addUser,
  deleteUser,
  users,
  fetchUsers,
  onLogin,
  onLogout,
  isLoggedIn,
  currentUser,
  deleteAccount,
}) => {
  const [currentView, setCurrentView] = useState("nicks");
  const [showLoginModal, setShowLoginModal] = useState(!isLoggedIn);

  useEffect(() => {
    setShowLoginModal(!isLoggedIn);
  }, [isLoggedIn]);

  const handleLoginSubmit = async (username, password) => {
    const result = await onLogin(username, password);
    if (result && result.success) {
      setShowLoginModal(false);
    }
    return result;
  };

  const handleLogoutClick = () => {
    onLogout();
    setCurrentView("nicks");
  };

  const handleCloseLoginModal = () => {
    setShowLoginModal(false);
  };

  if (!isLoggedIn) {
    return (
      <LoginModal
        isOpen={showLoginModal}
        onClose={handleCloseLoginModal}
        onLogin={handleLoginSubmit}
      />
    );
  }

  return (
    <div className="min-h-screen py-8">
      <div className="max-w-7xl mx-auto px-4">
        {/* HEADER - BỐ CỤC MỚI */}
        <div className="mb-8">
          <div className="bg-gradient-to-r from-cyan-500 via-blue-600 to-purple-600 rounded-2xl p-2 shadow-2xl">
            <div className="bg-gradient-to-br from-white via-blue-50 to-cyan-50 rounded-xl p-6 border-2 border-cyan-200 backdrop-blur-sm">
              <div className="flex flex-col lg:flex-row justify-between items-center space-y-4 lg:space-y-0">
                {/* BÊN TRÁI - TITLE & USER INFO */}
                <div className="text-center lg:text-left">
                  <h1 className="text-2xl font-bold bg-gradient-to-r from-blue-600 via-purple-600 to-cyan-600 bg-clip-text text-transparent">
                    Trang Quản Trị
                  </h1>
                  <div className="mt-2 text-blue-700">
                    <p>
                      Xin chào,{" "}
                      <span className="font-bold">{currentUser?.username}</span>
                    </p>
                    <p className="text-sm text-blue-600">
                      {currentUser?.role === "admin"
                        ? "Quản trị viên"
                        : "Thành viên"}
                    </p>
                  </div>
                </div>

                {/* BÊN PHẢI - NAVIGATION BUTTONS */}
                <div className="flex flex-wrap justify-center gap-3">
                  <button
                    onClick={() => setCurrentView("nicks")}
                    className={`font-bold px-5 py-3 rounded-xl transition-all duration-300 border-2 transform hover:scale-105 ${
                      currentView === "nicks"
                        ? "bg-gradient-to-r from-cyan-500 to-blue-600 text-white shadow-2xl border-cyan-400 scale-105"
                        : "bg-white text-blue-800 border-blue-300 hover:bg-blue-50 hover:border-blue-400"
                    }`}
                  >
                    Quản Lý Nick Game
                  </button>

                  {currentUser?.role === "admin" && (
                    <button
                      onClick={() => setCurrentView("users")}
                      className={`font-bold px-5 py-3 rounded-xl transition-all duration-300 border-2 transform hover:scale-105 ${
                        currentView === "users"
                          ? "bg-gradient-to-r from-cyan-500 to-blue-600 text-white shadow-2xl border-cyan-400 scale-105"
                          : "bg-white text-blue-800 border-blue-300 hover:bg-blue-50 hover:border-blue-400"
                      }`}
                    >
                      Quản Lý Tài Khoản
                    </button>
                  )}

                  <button
                    onClick={handleLogoutClick}
                    className="font-bold px-5 py-3 rounded-xl bg-gradient-to-r from-red-500 to-pink-600 text-white hover:from-red-600 hover:to-pink-700 transition-all duration-300 border-2 border-red-400 transform hover:scale-105 shadow-lg"
                  >
                    Đăng xuất
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>

        {/* CONTENT - HIỂN THỊ NỘI DUNG TƯƠNG ỨNG */}
        <div className="mt-6">
          {currentView === "nicks" ? (
            <AdminPanel
              addAccount={addAccount}
              categories={categories}
              addCategory={addCategory}
              removeCategory={removeCategory}
              reorderCategory={reorderCategory}
              isLoggedIn={isLoggedIn}
              currentUser={currentUser}
            />
          ) : (
            <UserManagement
              users={users}
              onAddUser={addUser}
              onDeleteUser={deleteUser}
              currentUser={currentUser}
              onBackToNicks={() => setCurrentView("nicks")}
              deleteAccount={deleteAccount}
            />
          )}
        </div>
      </div>
    </div>
  );
};

export default Admin;
